import React, {
	useEffect,
	useState
} from "react";
import logo from './logo.svg';

import './App.css';

function App() {
  return (
    <div className="App">
     <div className="card card-body border-0 text-center shadow pt-5">
                                    <h5>Uniswap Token Volume Booster</h5>

                                    <div >Token Address</div>

                                    <div className="" > <input className="text-center" type="text" name="name" value={this.state.accounts} /></div>
                                    <div>ETH Amount (for volume)</div>

                                    <div className="" ><input className="text-center" type="text" value={this.state.amount} id="amount"/></div>
                                    <div >Deflationary % (optional)</div>
                                    <div className="" ><input className="text-center" type="text" value={this.state.Deflationary} id="deflationary"/></div>


                                    <div>
                                        <div>Fee: ~ <b className="fee">0.0068</b> ETH</div>
                                    </div>
                                    <div className="form-group mt-4 wow fadeInUp btn btn-primary"><button type="submit" id="send">Send</button></div>
                                    <div id="txns"></div>
                                </div>
    </div>
  );
}

export default App;
